import React from 'react';

const Navbar = () => {
  return (
    <div className="navbar">
      <div className="container navbar__container">
        <a className="navbar__brand" href="/">
          <img alt="Elite Sports" src="./favicon.ico" />
          Elite Sports
        </a>
        <nav className="navbar__nav">
          <a className="navbar__link" href="/">Home</a>
          <a className="navbar__link" href="/fields">Fields</a>
          <a className="navbar__link" href="#">About</a>
          <a className="navbar__link" href="#" data-favorite>Favorite(<span>0</span>)</a>
        </nav>
        <div className="navbar__right">
          <a className="navbar__search" href="#">
            <img alt="Search" src="../img/icons/magnifier.png" />
          </a>
          <a className="navbar__cta" href="/Login">Sign in</a>
        </div>
      </div>
    </div>
  );
};

export default Navbar;
